--

ALTER TABLE `books`
  ADD PRIMARY KEY (`id`),
  ADD KEY `category_id` (`category_id`);


ALTER TABLE `categories`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `books`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=4;

ALTER TABLE `categories`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=4;

ALTER TABLE `books`
  ADD CONSTRAINT `books_ibfk_1` FOREIGN KEY (`category_id`) REFERENCES `categories` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION;

/*Tampilkan semua buku*/
SELECT * FROM books;

/*Tampilkan produk per kategori, field ditampilkan nama kategori, nama buku, stock*/
SELECT categories.name, books.name, books.stok FROM books INNER JOIN categories ON books.category_id=categories.id;

/*Tampilkan detail buku berdasarkan id, buku dengan id kedua yang ditampilkan*/
SELECT books.name, books.image, books.deskripsi, books.stok, categories.name FROM books INNER JOIN categories ON books.category_id=categories.id WHERE books.id=2;

